import { Component, Input } from '@angular/core';
import { PostService } from 'src/app/post.service';
import { Post } from 'src/app/types/post';

@Component({
  selector: 'app-home-post',
  templateUrl: './home-post.component.html',
  styleUrls: ['./home-post.component.css']
})
export class HomePostComponent {

  @Input('post') post = {} as Post;
}
<div class="row">
<div class="col-md-4 margin_top_3">
    <div class="our_img">
      <figure><img src="./../../assets/images/our_img3.jpg" alt="#" /></figure>
    </div>
    <div class="our_text_box three_box">
      <div class="post_box d_flex padding_top3">
        <h3 class="awesome padding_flot">{{post.title}}</h3>
      </div>
      <p>
        {{post.content}}
      </p>
    </div>
  </div>
</div>
